    			配色N0(体配色);
    			break;
    		case 配色指定.B0:
    			配色B0(体配色);
    			break;
    		case 配色指定.C0:
    			配色C0(体配色);
    			break;
    		case 配色指定.L0:
    			配色L0(体配色);
    			break;
    		default:
    			配色N0(体配色);
    			break;
    		}
    	}

